About Elly (2009) 
Alternatieve titel:  Darbareye Elly

Iran
Drama
119 minuten

geregisseerd door Asghar Farhadi
met Golshifteh Farahani, Taraneh Alidoosti en Marila Zare'i

Na jaren in Duitsland te hebben gewoond, keert Ahmad terug naar Iran. Zijn vrienden regelen een uitje naar de Kaspische Zee en proberen hem te koppelen aan Elly. Als zij plotseling verdwijnt, is ook de luchtige sfeer in een klap weg. Wat volgt is een koortsachtige zoektocht naar Elly.

Nederlandse ondertiteling: MAGICLIFE

